import { atom } from "recoil";

interface ToDoState {
  [key: string]: string[];
}

export const toDoState = atom({
  key: "toDo",
  default: {
    todo: ["a", "b"],
    doing: ["c", "d"],
    done: ["e", "f"],
  },
});
